import React from 'react';
import { Link } from 'react-router-dom';  // Import Link from react-router-dom
import './SignupForm.css';

const SignupForm = () => {
  return (
    <div className="signup-container">
      <h2>Signup</h2>
      <form>
        <div className="input-group">
          <label htmlFor="email">Your email</label>
          <input type="email" id="email" name="email" required />
        </div>
        <div className="input-group">
          <label htmlFor="password">Password</label>
          <input type="password" id="password" name="password" required />
        </div>
        <div className="forgot-password">
          <Link to="/forgot-password">Forgot password?</Link>  {/* Update to use Link */}
        </div>
        <button type="submit" className="signup-button">Signup</button>
      </form>
      <div className="or-divider">OR</div>
      <button className="google-login">
        <img src="https://img.icons8.com/color/16/000000/google-logo.png" alt="Google logo" /> Login with Google
      </button>
      <div className="login-link">
        Already have an account? <Link to="/login">Login</Link>  {/* Update to use Link */}
      </div>
    </div>
  );
};

export default SignupForm;
